DROP DATABASE IF EXISTS `YaSeJuega`;
CREATE DATABASE `YaSeJuega`;

USE `YaSeJuega`;

CREATE TABLE PREDIO 
(
	`PREDIO` NVARCHAR(25) NOT NULL,
	`TELEFONO` NVARCHAR(25) NOT NULL,
	`DIRECCION` NVARCHAR(25) NOT NULL,
	`GPS` NVARCHAR(25) NOT NULL,
	`ZONA` NVARCHAR(25) NOT NULL,
	`PRECIO` INTEGER NOT NULL,
	`SENA` INTEGER NOT NULL,
	`EXTRA` INTEGER NOT NULL,
	`PREDIO_PK` INTEGER PRIMARY KEY AUTO_INCREMENT,
	`URL` TEXT(100000) NOT NULL 
	);


CREATE TABLE `CANCHA` 
(
	`CANCHA` INTEGER NOT NULL,
	`TIPO` INTEGER NOT NULL,
	`SUPERFICIE` NVARCHAR(25) NOT NULL,
	`DEPORTE` NVARCHAR(25) NOT NULL,
	`TECHADO` INTEGER NOT NULL,
	`CANCHA_PK` INTEGER PRIMARY KEY AUTO_INCREMENT,
	`PREDIO_FK` INTEGER NOT NULL,
	FOREIGN KEY (`PREDIO_FK`) REFERENCES `PREDIO` (`PREDIO_PK`) ON DELETE NO ACTION ON UPDATE NO ACTION 
	);
 	 
CREATE TABLE `DISPONIBILIDAD` 
(
	`HS00` NVARCHAR(25) NOT NULL,
	`HS01` NVARCHAR(25) NOT NULL,
	`HS02` NVARCHAR(25) NOT NULL,
	`HS03` NVARCHAR(25) NOT NULL,
	`HS04` NVARCHAR(25) NOT NULL,
	`HS05` NVARCHAR(25) NOT NULL,
	`HS06` NVARCHAR(25) NOT NULL,
	`HS07` NVARCHAR(25) NOT NULL,
	`HS08` NVARCHAR(25) NOT NULL,
	`HS09` NVARCHAR(25) NOT NULL,
	`HS10` NVARCHAR(25) NOT NULL,
	`HS11` NVARCHAR(25) NOT NULL,
	`HS12` NVARCHAR(25) NOT NULL,
	`HS13` NVARCHAR(25) NOT NULL,
	`HS14` NVARCHAR(25) NOT NULL,
	`HS15` NVARCHAR(25) NOT NULL,
	`HS16` NVARCHAR(25) NOT NULL,
	`HS17` NVARCHAR(25) NOT NULL,
	`HS18` NVARCHAR(25) NOT NULL,
	`HS19` NVARCHAR(25) NOT NULL,
	`HS20` NVARCHAR(25) NOT NULL,
	`HS21` NVARCHAR(25) NOT NULL,
	`HS22` NVARCHAR(25) NOT NULL,
	`HS23` NVARCHAR(25) NOT NULL,
	`PREDIO_FK` INTEGER NOT NULL,
	FOREIGN KEY (`PREDIO_FK`) REFERENCES `PREDIO` (`PREDIO_PK`) ON DELETE NO ACTION ON UPDATE NO ACTION 
	);

CREATE TABLE `USUARIO` 
(
	`NOMBRE` NVARCHAR(25) NOT NULL,
	`APELLIDO` NVARCHAR(25) NOT NULL,
	`EMAIL` NVARCHAR(25) NOT NULL,
	`USUARIO` NVARCHAR(25) NOT NULL,
	`CONTRASENA` NVARCHAR(50) NOT NULL,
	`CELULAR` NVARCHAR(25) NOT NULL,
	`USUARIO_PK` INTEGER PRIMARY KEY AUTO_INCREMENT
	);


CREATE TABLE `RESERVA` 
(
	`FECHA` DATE NOT NULL,
	`HORA` INTEGER NOT NULL,
	`ESTADO` NVARCHAR(25) NOT NULL,
	`PRECIO` INTEGER NOT NULL,
	`SENA` INTEGER NOT NULL,
	`TIMESTAMP` TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	`USUARIO_FK` INTEGER NOT NULL,
	`CANCHA_FK` INTEGER NOT NULL,
	`RESERVA_PK` INTEGER PRIMARY KEY AUTO_INCREMENT,
	FOREIGN KEY (`CANCHA_FK`) REFERENCES `CANCHA` (`CANCHA_PK`) ON DELETE NO ACTION ON UPDATE NO ACTION,
	FOREIGN KEY (`USUARIO_FK`) REFERENCES `USUARIO` (`USUARIO_PK`) ON DELETE NO ACTION ON UPDATE NO ACTION 
	);


CREATE TABLE `FERIADO`
(
	`FECHA` DATE NOT NULL,
	`FERIADO_PK` INTEGER PRIMARY KEY AUTO_INCREMENT
	);


CREATE TABLE `EXCEPCION`
(
	`FECHA` NVARCHAR(25) NOT NULL,
	`PREDIO_FK` INTEGER NOT NULL,
	`EXCEPCION_PK` INTEGER PRIMARY KEY AUTO_INCREMENT,
	FOREIGN KEY (`PREDIO_FK`) REFERENCES `PREDIO` (`PREDIO_PK`) ON DELETE NO ACTION ON UPDATE NO ACTION
	);


CREATE TABLE `VALORACION`
(
	`VALORACION` INTEGER NOT NULL,
	`RESERVA_FK` INTEGER NOT NULL,
	FOREIGN KEY (`RESERVA_FK`) REFERENCES `RESERVA` (`RESERVA_PK`) ON DELETE NO ACTION ON UPDATE NO ACTION
	);
CREATE TABLE `TORNEO`
(
	`EQUIPO` INTEGER NOT NULL,
	`FECHA_INICIO` DATE NOT NULL,
	`FECHA_LIMITE` DATE NOT NULL,
	`PRECIO` INTEGER NOT NULL,
	`PRECIOxPARTIDO` INTEGER NOT NULL,
	`PREDIO_FK` INTEGER NOT NULL,
	`TORNEO_PK` INTEGER PRIMARY KEY AUTO_INCREMENT,
	FOREIGN KEY (`PREDIO_FK`) REFERENCES `PREDIO` (`PREDIO_PK`) ON DELETE NO ACTION ON UPDATE NO ACTION
	);

